event.script:

var @array = getPartyArray();

foreach (declare $character) in @array
{
    doDamage($character,0-getCharacterAttribute($character,$_MAXHP)-getCharacterAttribute($character,$_HP));
    print(getCharacterName($character) + " HP = " + getCharacterAttribute($character,$_HP));
    setCharacterToggle($character,$_ALIVE,true);
}
declare $item = randomItem($_DROP_RARE,100,4000);
if(is_valid($item))
    giveItem($item,1,false);


var $decision = choice("Make your choice:", 
    array("Mochi Team!","One Mochi","Shop","Sell","Walk","Event","Save","Nevermind"));
switch($decision){
    case 0:
        startBattle("Green Tea Mochi",3,false,"grasslands");
    break;
    case 1:
        startBattle("Green Tea Mochi",1,false,"grasslands");
    break;
    case 2:
        var @items = array(getNamedItem("Moon Seed"), getNamedItem("Sun Seed"), randomItem($_DROP_UNCOMMON,100,400));
        shop(@items);
    break;
    case 3:
        sell();
    break;
    case 4:
    playScene(function(){
        using "scene";
        var $moveSam = moveObject(getObject("Karate Cat"),0,0,12);
        var $moveSam2 = moveObject(getObject("Samara"),13,4,12);
        waitFor(fadeObject(getObject("Karate Cat"),false,1));
        waitFor(fadeObject(getObject("Karate Cat"),true,1));

        fadeObject(getObject("Samara"),false,4);                                        
        waitFor($moveSam);
        waitFor($moveSam2);
        dialog("Karate Cat", "Here I go!",2.0);
        //say("Karate Cat", "Here I go!");
        waitFor(moveObject(scene::getObject("Karate Cat"),2,10,12));
        waitFor(fadeObject(getObject("Karate Cat"),false,1.0));
    });
    break;
    case 5:
        playScene(function(){
            using "scene";
            panTo(-4,-4,1);
            declare $newguy = addSprite("Npc/Cat2",$_SIZE_SMALL,$_MOVE_NSEW,4,4,$_SOUTH);
            hideObject($newguy);
            fadeObject($newguy,true,4.0);
            waitFor(moveObject($newguy,20,20,$_MOVE_FAST*3));
            declare $pan = panTo(10,10,2);
            fadeOut(2);

            }
        );
    break;
    case 6:
        save();
    break;

    default:
        say("Podium","Very well.");
    break;

}

